class App extends React.Component {
    constructor(props){
        super(props)
        this.state={
            users:null,
        }
    this.data=this.data.bind(this)
    }
   data(){
     navigate('hello')
     //fetch('http://localhost:9000/testAPI/add?amount=700&joins=100&users=7').then( res => res.text()).then(res => console.log(res))
    }
    componentDidMount(){
     this.data()
    }
   render(){
    return(
        <Router>
        <div path="/"> 
        <Header />
        <div className="container" style={{marginTop:"66px"}}>
         <CardList />
        </div>
        <div className="fixed-bottom">
           <div className="badge text-light" onClick={this.data}>SELL</div>
        </div>
        </div>
        <div path="/hello">Hello</div>
        </Router>
       );
   }
}


export default App;
